import React from "react";
import "./intro.css";
import bg from "../../assets/bg.png"
import { Link } from "react-scroll";
import hireMe from "../../assets/hireMe.png"

const Intro = () => {
    return (
        <section id="intro">
            <div className="introContent">
                <span className="hello">Hello</span>
                <span className="introText">I'm <span className="introName">Priyanshu</span><br />Website Developer </span>
                <p className="introPara">I am a skilled web designer with experience in<br /> creating visually appealing and user friendly websites.</p>
                <Link activeClass='active' to='contact' spy={true} smooth={true} offset={-100} duration={500}><button className="btn"><img className="btnImg" src={hireMe} alt="btnImg" />Hire Me</button></Link>
                <button class="Btn">
                    Pay
                    <svg class="svgIcon" viewBox="0 0 576 512"><path d="M512 80c8.8 0 16 7.2 16 16v32H48V96c0-8.8 7.2-16 16-16H512zm16 144V416c0 8.8-7.2 16-16 16H64c-8.8 0-16-7.2-16-16V224H528zM64 32C28.7 32 0 60.7 0 96V416c0 35.3 28.7 64 64 64H512c35.3 0 64-28.7 64-64V96c0-35.3-28.7-64-64-64H64zm56 304c-13.3 0-24 10.7-24 24s10.7 24 24 24h48c13.3 0 24-10.7 24-24s-10.7-24-24-24H120zm128 0c-13.3 0-24 10.7-24 24s10.7 24 24 24H360c13.3 0 24-10.7 24-24s-10.7-24-24-24H248z"></path></svg>
                </button>
            </div>
            <img className="bg" src={bg} alt="bg" />
        </section>
    )
};


export default Intro
